    __webpack_exports__["default"] = "<ion-header>\n  <ion-toolbar>\n    <ion-buttons slot=\"start\">\n      <ion-menu-button color='danger'></ion-menu-button>\n    </ion-buttons>\n    <ion-title>\n      Materiais Pesados\n      \n    </ion-title>\n  </ion-toolbar>\n</ion-header>\n\n<ion-content>\n  <ion-slides [options]='slideOpts'>\n\n    <ion-slide (click)=\"openModal()\">\n      <ion-card>\n        <ion-card-header>\n          <ion-card-title>Niobio</ion-card-title>\n        </ion-card-header>\n\n        <ion-card-content>\n          <img src=\"/assets/pesados/niobio.jpg\" alt=\"Niobio\">\n          <br>\n          <p class=\"ion-text-justify\">\n            O nióbio é usado em produtos diversos, desde turbinas de avião até lâminas de barbear. Ele também é supercondutor.\n            <br><br>\n            Os aços microligados ao nióbio aumentam simultaneamente a resistência e a tenacidade, fundamentais para responder aos desafios da construção moderna, principalmente no caso de regulamentações quanto a incêndios e terremotos.\n            <br><br>\n            Teor de Nióbio acima de 60%.\n          </p>\n        </ion-card-content>\n      </ion-card>\n    </ion-slide>\n    \n\n    <ion-slide (click)=\"openModal()\">\n      <ion-card>\n        <ion-card-header>\n          <ion-card-title>Tantalita</ion-card-title>\n        </ion-card-header>\n\n        <ion-card-content>\n          <img src=\"/assets/pesados/tantalita.jpg\" alt=\"Tantalita\">\n          <br>\n          <p class=\"ion-text-justify\">\n            Tantalita é um minério bastante aplicado na indústria eletrônica pois oferece resistência ao calor.\n            <br><br>\n            Bastante usado na indústria do vidro, por aumentar o índice de refração, no aço cirúrgico, sendo não-reativo nos tecidos corporais.\n          </p>\n        </ion-card-content>\n      </ion-card>\n    </ion-slide>\n\n\n    <ion-slide (click)=\"openModal()\">\n      <ion-card>\n        <ion-card-header>\n          <ion-card-title>Manganês</ion-card-title>\n        </ion-card-header>\n\n        <ion-card-content>\n          <img src=\"/assets/pesados/manganes-mineradora-atalaia.jpg\" alt=\"Manganês\">\n          <br>\n          <p class=\"ion-text-justify\">\n            O manganês, quarto metal mais utilizado do mundo, está presente na composição várias coisas que fazem parte do seu dia a dia, como a pilha e a tinta.\n            <br><br>\n            É essencial na fabricação de aço, e também de ferroligas, combinações de ferro com um ou mais elementos químicos, como o próprio manganês.\n            <br><br>\n            Teor de Manganês acima de 40%.\n          </p>\n        </ion-card-content>\n      </ion-card>\n    </ion-slide>\n\n\n    <ion-slide (click)=\"openModal()\">\n      <ion-card>\n        <ion-card-header>\n          <ion-card-title>Minério de Ferro</ion-card-title>\n        </ion-card-header>\n\n        <ion-card-content>\n          <img src=\"/assets/pesados/minerio-de-ferro.jpg\" alt=\"Minério de Ferro\">\n          <br>\n          <p class=\"ion-text-justify\">\n            O minério de ferro é encontrado na natureza na forma de rochas, misturado a outros elementos. Por meio de diversos processos industriais com tecnologia de ponta, o minério é beneficiado para, posteriormente, ser vendido para as indústrias​ siderúrgicas.\n            <br><br>\n            Na construção de casas, na fabricação de carros e na produção de eletrodomésticos, encontra-se um pouquinho do minério de ferro produzido pela Mineradora Atalaia.\n          </p>\n        </ion-card-content>\n      </ion-card>\n    </ion-slide>\n\n\n    <ion-slide (click)=\"openModal()\">\n      <ion-card>\n        <ion-card-header>\n          <ion-card-title>Pedra de Alvenaria</ion-card-title>\n        </ion-card-header>\n\n        <ion-card-content>\n          <img src=\"/assets/pesados/pedra alvenaria.jpg\" alt=\"Pedra de Alvenaria\">\n          <br>\n          <p class=\"ion-text-justify\">\n            Pedra de Alvenaria para construção civil. Temos a quantidade que você precisa.\n            <br><br>\n            Para comprar Pedra de Alvenaria na Mineradora Atalaia, basta um toque!\n          </p>\n        </ion-card-content>\n      </ion-card>\n    </ion-slide>\n\n\n    <ion-slide (click)=\"openModal()\">\n      <ion-card>\n        <ion-card-header>\n          <ion-card-title>Brita</ion-card-title>\n        </ion-card-header>\n\n        <ion-card-content>\n          <img src=\"/assets/pesados/brita.jpg\" alt=\"Brita\">\n          <br>\n          <p class=\"ion-text-justify\">\n            A Mineradora Atalaia do Brasil possui vários tipos de Brita.\n            <br><br>\n            São elas:\n            <br>\n            Brita 0, Brita 1, Brita 2, Brita 3 e Brita 4.\n            <br><br>\n            A Brita é indicada para confecção de concretos em geral, vigas e vigotas, lajes pré-moldadas, pavimento intertravado, tubos, blocos, chapiscos e acabamentos em geral.\n          </p>\n        </ion-card-content>\n      </ion-card>\n    </ion-slide>\n\n\n    <ion-slide (click)=\"openModal()\">\n      <ion-card>\n        <ion-card-header>\n          <ion-card-title>Areia Grossa</ion-card-title>\n        </ion-card-header>\n\n        <ion-card-content>\n          <img src=\"/assets/pesados/areiagrossa.jpg\" alt=\"Areia Grossa\">\n          <br>\n          <p class=\"ion-text-justify\">\n            A areia é um dos materiais fundamentais para construções de qualquer tipo. \n            <br>\n            Junto com a pedra britada, ela compõe o concreto que vai ser usado, além de poder ser usada na decoração.\n            <br><br>\n            Indicada para mistura de concreto, utilizada para a sustentação de lajes e colunas.\n          </p>\n        </ion-card-content>\n      </ion-card>\n    </ion-slide>\n  </ion-slides>\n</ion-content>\n";
